    CandidateProfileComponent.prototype.disableLinks = function (i, j) {
        if (this.educations.controls[this.educations.controls.length - 1].value
            .qualification === '') {
            this.disableLink = false;
        }
        else {
            if (this.educations.controls[this.educations.controls.length - 1].value
                .qualification === 'Doctrate PHD') {
                this.addfieldsFormGroup();
                this.disableLink = false;
                this.changeQualifuctions(1, j);
            }
            else if (this.educations.controls[this.educations.controls.length - 1].value
                .qualification === 'Masters/Post Graduation') {
                this.addfieldsFormGroup();
                this.disableLink = false;
                this.changeQualifuctions(2, j);
            }
            else if (this.educations.controls[this.educations.controls.length - 1].value
                .qualification === 'Graduation/Diploma') {
                this.changeQualifuctions(3, j);
                this.disableLink = false;
                this.addfieldsFormGroup();
            }
            else if (this.educations.controls[this.educations.controls.length - 1].value
                .qualification === '12th') {
                // this.addfieldsFormGroup();
                this.disableLink = true;
                this.changeQualifuctions(4, j);
            }
            else if (this.educations.controls[this.educations.controls.length - 1].value
                .qualification === '10th') {
                this.disableLink = false;
            }
            else if (this.educations.controls[this.educations.controls.length - 1].value
                .qualification === 'Below 10th') {
                this.disableLink = false;
                this.clearForm();
            }
            else {
                this.disableLink = false;
            }
        }
    };
